import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <>
      <h1>Far Away</h1>
      <div>
        <h2>What do you need for your trip</h2>
        <select>
          <option value='1'>1</option>
          <option value='2'>2</option>
          <option value='3'>3</option>
          <option value='4'>4</option>
        </select>
        <input></input>
      </div>
    </>
  );
}

export default App;
